Information
------------------------------

Hitlers Jurassic Monsters
This is the untold story of a Nazi vision that went far beyond the military conquest of European countries. 
As part of their crazed dream to create a thousand-year Reich they developed detailed blueprints for Aryan settlements and vast hunting parks for 'Aryan' animals.Goering and Himmler employed Germany's best scientists to launch a hugely ambitious programme of genetic manipulation to change the course of nature itself, both in the wild and for domestic use.
In a fascinating blend of politics and biology, Hitler's Jurassic Monsters is the true and asthonishing story of how the Nazis tried to take control of nature and change the course of evolution.

